@page {

body {

.page {

  grid-template-rows: repeat(4, 60mm); /* 4 rows of 60mm */

  align-content: center;
  page-break-inside: avoid;

  width: 60mm;
  height: 60mm;

  justify-content: center;
  align-items: center;

.front {

  font-weight: bold;
  margin-top: 2mm;
}

.front .year {
  font-size: 3.5em;
  font-weight: bold;
  margin: auto 0;
}

.front .song-name {
  font-size: 1em;
  margin-bottom: 2.5mm;
}

.front .serial-number {
  position: absolute;
  bottom: 1mm;
  left: 1mm;
  font-size: 0.5em;
  color: #333;
}
